__Hash__ hanya satu arah dan gunakan crypto random Salt supaya lebih dalam __hashing__-nya. Karena hash satu arah, maka per verifikasi hasrus dengan salt yg disimpan juga. Jadi setiap password tersimpan di database tidak ada yang sama Salt-nya dan Hash-nya, walaupun password text-nya sama. Kalau contoh bisa seperti ini,

```void Main()
{
  Console.WriteLine("Password-nya sama tapi Hashed berbeda2 dan bisa diverifikasi
");
  string password = "w@ei_8|2292$&38998(*(*Gew";

  var hashedPassword1 = GeneratePasswordHash(password);
  Console.WriteLine("Password: " + hashedPassword1);

  var verifyCheck1 = VerifyPassword(password, hashedPassword1);
  Console.WriteLine("Verify: " + verifyCheck1);

  Console.WriteLine();

  var hashedPassword2 = GeneratePasswordHash(password);
  Console.WriteLine("Password: " + hashedPassword2);

  var verifyCheck2 = VerifyPassword(password, hashedPassword2);
  Console.WriteLine("Verify: " + verifyCheck2);
}

public static bool VerifyPassword(string password, string hashPasswordBase64)
{
  var hashPassword = hashPasswordBase64.Split('|');
  var saltBytes = Convert.FromBase64String(hashPassword[0]);
  var rfc2898DeriveBytes = new Rfc2898DeriveBytes(password, saltBytes, 10000);
  return Convert.ToBase64String(rfc2898DeriveBytes.GetBytes(256)) == hashPassword[1];
}

public static string GeneratePasswordHash(string password)
{
  var saltBytes = new byte[64];

  // Generate Crypto Random Number Generator
  new RNGCryptoServiceProvider().GetNonZeroBytes(saltBytes);
  var rfc2898DeriveBytes = new Rfc2898DeriveBytes(password, saltBytes, 10000).GetBytes(256);

  var hashPasswordBase64 = Convert.ToBase64String(rfc2898DeriveBytes);
  var saltBase64 = Convert.ToBase64String(saltBytes);

  return $"{saltBase64}|{hashPasswordBase64}";
}```

